import React from 'react';
import Appbar from '../components/app_bar';
import Send_question from '../components/send_question';
import Grid from '@material-ui/core/Grid';

export default props => {
    return (
      <div>
      <Grid container spacing={3}>
      <Grid item xs={12}>
        <Appbar/>
      </Grid>
      <Grid item xs={12}>
        <Send_question/>
      </Grid>
      </Grid>
      </div>
    );
}
